import Banner from "./banner";
import PTList from "./ptlist"


const App = () => {
  return (
    <div style={{ display: 'block', 
                  width: 1500, padding: 30 }}> 
      <Banner>
        <div> Physical Therapists at Movement-X</div>
      </Banner>
      <div>
      <PTList />
      </div>
    </div>
  );
};

export default App;
